      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - 13 * - + col2 - + + ( + col2 ) NOT IN ( - col1 * 67 + col2 + + ( - col2 ) * col2 + col1 );
  - name: tab1

outputs:
  - name: q768.out
    data: |
